import{_ as e}from"./chunks/exploration.bd9cc679.js";import{_ as t,o,c as a,Q as n}from"./chunks/framework.6e0d310a.js";const s="/teamone/img/explorer/exploration_create.png",l="/teamone/img/explorer/exploration_menu.png",i="/teamone/img/explorer/exploration_reload.png",r="/teamone/img/explorer/group_rows.png",c="/teamone/img/explorer/hierarchy_level_indentation.png",m="/teamone/img/explorer/autofit_columns.png",p="/teamone/img/explorer/dimension_menu.png",u="/teamone/img/explorer/filter_dimension.png",h="/teamone/img/explorer/mdx.png",d="/teamone/img/explorer/mdx_element_list.png",g="/teamone/img/explorer/select_elements.png",b="/teamone/img/explorer/selected_elements_save_as_subset.png",f="/teamone/img/explorer/save_refresh.png",x="/teamone/img/explorer/exploration_save_as_cube_view.png",y="/teamone/img/explorer/calculated_column_arrayformula.png",I=JSON.parse('{"title":"TeamOne Explorer","description":"","frontmatter":{},"headers":[],"relativePath":"doc/explorer.md","filePath":"doc/explorer.md"}'),w={name:"doc/explorer.md"},_=n('<h1 id="teamone-explorer" tabindex="-1">TeamOne Explorer <a class="header-anchor" href="#teamone-explorer" aria-label="Permalink to &quot;TeamOne Explorer&quot;">​</a></h1><p><strong>TeamOne Explorer</strong> is your <em><strong>Planning Analytics for Google Sheets</strong></em>. You can easily create <em>explorations</em> (cube views) by selecting dimensions and elements in the sidebar and the data will be refreshed directly in the Google Sheets grid. <img src="'+e+'" alt="img"></p><div class="tip custom-block"><p class="custom-block-title">Custom content</p><p>When recalculating a new <em>Exploration</em> for the first time, it will be printed starting from the cell A1. You can add extra columns and rows with custom content above or below the exploration rows. TeamOne will automatically detect the new exploration coordonates and update it accordingly.</p></div><h2 id="create-exploration" tabindex="-1">Create exploration <a class="header-anchor" href="#create-exploration" aria-label="Permalink to &quot;Create exploration&quot;">​</a></h2><p>You can open <strong>TeamOne Explorer</strong> from the sidebar using the <em><strong>Explorer</strong></em> button on first tab. When you create a new exploration it becomes linked to the current open sheet and gets the same name as the sheet. When you open the <em><strong>Explorer</strong></em> screen, it will load the current sheet exploration if it exists, otherwise you will be able to create a new exploration or select an existing one to open. <img src="'+s+'" alt="img"></p><div class="tip custom-block"><p class="custom-block-title">System cubes</p><p>You can select system cubes by selecting <em>Show system objects</em> from the menu</p></div><h2 id="open-exploration" tabindex="-1">Open exploration <a class="header-anchor" href="#open-exploration" aria-label="Permalink to &quot;Open exploration&quot;">​</a></h2><p>When you click the <em><strong>Explorer</strong></em> button, it will load the current sheet exploration if it exists, otherwise you will be able to create a new exploration for the current sheet. To open a different exploration, you can either switch to the sheet you want to open the exploration for and click the <em><strong>Explorer</strong></em> button or you can do it using the <em>Other explorations</em> menu option. TeamOne will automatically switch to the corresponding sheet for you. <img src="'+l+'" alt="img"></p><div class="tip custom-block"><p class="custom-block-title">Reload active sheet exploration</p><p>If you navigate to a different sheet, simply click the exploration icon to reload its exploration</p></div><p><img src="'+i+'" alt="img"></p><h2 id="exploration-cube" tabindex="-1">Exploration cube <a class="header-anchor" href="#exploration-cube" aria-label="Permalink to &quot;Exploration cube&quot;">​</a></h2><p>You select the cube name when creating a new exploration or you can change the existing exploration cube in the exploration settings, which you can open from the exploration menu or simply by clicking the cube name.</p><p>In both cases TeamOne will build a sample exploration for you by selecting the last 2 dimensions for your rows and columns and using <a href="./functions.html#mdx-mods">$ALL</a> MDX mod to dynamically select all elements for each dimension.</p><h2 id="include-empty-rows" tabindex="-1">Include empty rows <a class="header-anchor" href="#include-empty-rows" aria-label="Permalink to &quot;Include empty rows&quot;">​</a></h2><p>By default TeamOne will suppress empty rows. Select <em>Include empty rows</em> to include elements with no amounts or text data.</p><h2 id="include-empty-columns" tabindex="-1">Include empty columns <a class="header-anchor" href="#include-empty-columns" aria-label="Permalink to &quot;Include empty columns&quot;">​</a></h2><p>By default TeamOne will suppress empty columns. Select <em>Include empty columns</em> to include elements with no amounts or text data.</p><h2 id="formatted-values" tabindex="-1">Formatted values <a class="header-anchor" href="#formatted-values" aria-label="Permalink to &quot;Formatted values&quot;">​</a></h2><p>TeamOne can retrieve data with formatting defined in IBM PA or you can retrieve the unformatted values (recommended if you intend to update and save the data back to IBM PA).</p><h2 id="groups-rows" tabindex="-1">Groups rows <a class="header-anchor" href="#groups-rows" aria-label="Permalink to &quot;Groups rows&quot;">​</a></h2><p>By default TeamOne will group rows elements (print distinct row element names). Uncheck the <em>Group rows</em> option if you prefer to repeat all the row elements. <img src="'+r+'" alt="img"></p><h2 id="hierarchy-indentation" tabindex="-1">Hierarchy indentation <a class="header-anchor" href="#hierarchy-indentation" aria-label="Permalink to &quot;Hierarchy indentation&quot;">​</a></h2><p>By default TeamOne will indent rows elements by the hiearchy level. Uncheck the <em>Hierarchy indentation</em> option if you prefer to print the rows elements without indentation. <img src="'+c+'" alt="img"></p><h2 id="autofit-columns" tabindex="-1">Autofit columns <a class="header-anchor" href="#autofit-columns" aria-label="Permalink to &quot;Autofit columns&quot;">​</a></h2><p>By default TeamOne will autoresize columns to fit the content. Uncheck the <em>Autofit columns</em> option if you prefer to keep the current columns width. <img src="'+m+'" alt="img"></p><h2 id="rows-columns-and-filters" tabindex="-1">Rows, columns and filters <a class="header-anchor" href="#rows-columns-and-filters" aria-label="Permalink to &quot;Rows, columns and filters&quot;">​</a></h2><p>Each exploration has 3 dimension areas: rows, columns and filters. You can manually select elements or use and existing subset or use a subset expression for row and column dimensions. You can select a single element for each <em>filter</em> dimension</p><h2 id="rearrange-dimensions" tabindex="-1">Rearrange dimensions <a class="header-anchor" href="#rearrange-dimensions" aria-label="Permalink to &quot;Rearrange dimensions&quot;">​</a></h2><p>You can move dimensions between areas (rows, columns and titles) or up and down within an area (to change the order of nesting) using the dimension context menu. Using the same menu you can quickly select ALL, ROOTS or LEAVES subsets: <img src="'+p+'" alt="img"></p><div class="tip custom-block"><p class="custom-block-title">Row and column dimensions</p><p>You should have at least 1 row and 1 column dimension.</p></div><h2 id="filter-elements" tabindex="-1">Filter elements <a class="header-anchor" href="#filter-elements" aria-label="Permalink to &quot;Filter elements&quot;">​</a></h2><p>Click a filter dimension to select an element. The subset screen will open and the element dropdown field will be activated automatically and you can start typing the element name or simply select it from the list. You can also select a different hierarchy, an existing subset and attribute or use an MDX to control the element list.</p><p><img src="'+u+'" alt="img"></p><p>You can unselect the element by clicking the clear icon on the right</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>While typing the element name, hit <em>ENTER</em> to select the first highlighted element and close the subset screen.</p></div><h2 id="default-elements" tabindex="-1">Default elements <a class="header-anchor" href="#default-elements" aria-label="Permalink to &quot;Default elements&quot;">​</a></h2><p>If you do not select a filter element, TeamOne will use a <em>default element</em> for that dimension, which is usually the first top level consolidated element user has access to. <em>Default element</em> can also be set by TM1 administrator in <em>}HierarchyProperties</em> control cube. Keep in mind, if there is element security defined for a given dimension, users may see a different default element depending on their permissions.</p><h2 id="row-and-column-elements" tabindex="-1">Row and column elements <a class="header-anchor" href="#row-and-column-elements" aria-label="Permalink to &quot;Row and column elements&quot;">​</a></h2><p>For row and column dimensions you can choose to display elements from an existing subset, use an MDX expression or pick the elements manually</p><h3 id="subset" tabindex="-1">Subset <a class="header-anchor" href="#subset" aria-label="Permalink to &quot;Subset&quot;">​</a></h3><p>Simply select a subset from the Subset list and TeamOne will fetch the elements automatically.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>If subset has an alias, it will be selected automatically as well</p></div><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>If subset is dynamic, the MDX button color will change to &quot;indigo&quot; and you will be able to see the expression by hovering the mouse of the MDX button</p></div><h3 id="mdx" tabindex="-1">MDX <a class="header-anchor" href="#mdx" aria-label="Permalink to &quot;MDX&quot;">​</a></h3><p>Use the MDX button to edit the existing MDX expression or create a new one. In the MDX editor you type the expression manually or use the <a href="./functions.html#mdx-mods">MDX mods</a> buttons at the top to build an expression with no code.</p><p>For instance, the next expression will filter all the leaf level <em><strong>Organization</strong></em> dimension elements by the <em><strong>currency</strong></em> attribute value equal to <em><strong>CDN</strong></em> and will select the first 2 elements. You can also use the <em>Convert MDX</em> button to get the real MDX:</p><p><img src="'+h+'" alt="img"></p><p>More over you can simply type or copy-paste the elements. Or even use wildcard patterns: <img src="'+d+'" alt="img"></p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>MDX expressions are dynamic, meaning the element list will be evaluated upon refreshing exploration data</p></div><h3 id="select-elements" tabindex="-1">Select elements <a class="header-anchor" href="#select-elements" aria-label="Permalink to &quot;Select elements&quot;">​</a></h3><p>Finally you can select elements manually:</p><p><img src="'+g+'" alt="img"></p><h2 id="save-selected-elements-as-subset" tabindex="-1">Save selected elements as subset <a class="header-anchor" href="#save-selected-elements-as-subset" aria-label="Permalink to &quot;Save selected elements as subset&quot;">​</a></h2><p>Use <em><strong>Save as subset</strong></em> menu option to save subsets back to IBM Planning Analytics, so they can be available in Planning Analytics Workspace, Planning Analytics for Excel, TM1Web, TM1 Architect, etc.</p><p><img src="'+b+'" alt="img"></p><h2 id="refresh-exploration" tabindex="-1">Refresh exploration <a class="header-anchor" href="#refresh-exploration" aria-label="Permalink to &quot;Refresh exploration&quot;">​</a></h2><p>Click the <em><strong>Refresh data</strong></em> button to refresh the exploration data on its sheet. This will also save all your exploration changes. Depending on the exploration data volume it may take time to fetch and print all the data. For large explorations TeamOne will split data requests into multiple packages, up to 16384 cells each. Each result will be printed on the sheet as soon as it is received.</p><p><img src="'+f+'" alt="img"></p><h2 id="save-exploration-as-cube-view" tabindex="-1">Save exploration as cube view <a class="header-anchor" href="#save-exploration-as-cube-view" aria-label="Permalink to &quot;Save exploration as cube view&quot;">​</a></h2><p>Use <em><strong>Save as cube view</strong></em> exploration menu option to save cube views back to IBM Planning Analytics, so they can be available in Planning Analytics Workspace, Planning Analytics for Excel, TM1Web, TM1 Architect, etc.</p><p><img src="'+x+'" alt="img"></p><h2 id="calculated-columns" tabindex="-1">Calculated columns <a class="header-anchor" href="#calculated-columns" aria-label="Permalink to &quot;Calculated columns&quot;">​</a></h2><p>You can add custom calculated columns after the last exploration column using <strong>ARRAYFORMULA()</strong>, as it can calculate multiple values based on the provided range of cells. More complex formulas can be constructed depending on the requirements. Keeping the <em>ARRAYFORMULA</em> in the very first exploration data row (the very first row under the frozen headers) will prevent it from being wiped when recalculating the exploration.</p><p><img src="'+y+'" alt="img"></p>',64),v=[_];function k(q,P,T,A,M,O){return o(),a("div",null,v)}const D=t(w,[["render",k]]);export{I as __pageData,D as default};
